import React from 'react';
import { Button } from 'reactstrap';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import profilePhoto from './components/profile/profilePhoto';
function App() {
  return (
    <div className="App">
          <Container>
              <Row>
                   <Col> 
                      <profilePhoto />
                   </Col>
                   <Col>
                      <fullname />
                      <adress />
                   </Col>
                </Row>
            </Container>
    </div>
  );
}

export default App;
